/*Table structure for table `user_message_db` */

DROP TABLE IF EXISTS `user_message_db`;

CREATE TABLE `user_message_db` (
  `user_message_id` int(16) NOT NULL AUTO_INCREMENT COMMENT '用户消息id',
  `user_message_author` varchar(32) NOT NULL DEFAULT '系统' COMMENT '作者',
  `user_message_time` varchar(32) NOT NULL COMMENT '发送时间',
  `user_message_title` varchar(64) NOT NULL COMMENT '消息标题',
  `user_message_content` longtext NOT NULL COMMENT '消息内容',
  `has_read` int(2) NOT NULL DEFAULT '0' COMMENT '是否已读，1已读，0未读',
  `user_message_recipient` varchar(128) NOT NULL COMMENT '消息接收者',
  `user_message_link` longtext COMMENT '消息链接',
  `user_message_img` longtext COMMENT '消息图片',
  PRIMARY KEY (`user_message_id`),
  KEY `FK_user_message_db` (`user_message_recipient`),
  CONSTRAINT `FK_user_message_db` FOREIGN KEY (`user_message_recipient`) REFERENCES `user_db` (`user_authentication_id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;

