/*Table structure for table `user_question_db` */

DROP TABLE IF EXISTS `user_question_db`;

CREATE TABLE `user_question_db` (
  `user_question_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户提问表主键id',
  `user_authentication_id` varchar(128) NOT NULL COMMENT '用户认证id',
  `user_question` varchar(64) NOT NULL COMMENT '用户提出的问题',
  `user_question_describe` longtext NOT NULL COMMENT '用户提问内容',
  `user_question_isread` int(4) DEFAULT '0' COMMENT '0未读，1已读',
  `user_question_isreply` int(4) DEFAULT '0' COMMENT '0未回复，2已回复',
  PRIMARY KEY (`user_question_id`),
  KEY `user_authentication_id` (`user_authentication_id`),
  CONSTRAINT `user_question_db_ibfk_1` FOREIGN KEY (`user_authentication_id`) REFERENCES `user_db` (`user_authentication_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `user_question_db` */

insert  into `user_question_db`(`user_question_id`,`user_authentication_id`,`user_question`,`user_question_describe`,`user_question_isread`,`user_question_isreply`) values (3,'3718919977F76484EAF1E4C554CCB459','第一个测试版本','啦啦啦啦啦啦啦凉凉',0,0);

/*Table structure for table `user_t` */

DROP TABLE IF EXISTS `user_t`;

CREATE TABLE `user_t` (
  `id` varchar(32) NOT NULL COMMENT '用户id，唯一识别标识',
  `campus` varchar(10) DEFAULT NULL COMMENT '校区',
  `username` varchar(16) NOT NULL COMMENT '用户名',
  `real_name` varchar(16) NOT NULL COMMENT '真实姓名',
  `password` varchar(64) NOT NULL COMMENT '密码',
  `role` varchar(16) DEFAULT NULL COMMENT '角色',
  `has_log` tinyint(1) DEFAULT '0' COMMENT '是否登录过',
  `login_ip` varchar(64) DEFAULT NULL COMMENT '登录ip',
  `sicau_id` varchar(16) DEFAULT NULL COMMENT '学号或工号',
  `login_browser_info` varchar(200) DEFAULT NULL COMMENT '首次登录设备信息',
  `log_cookie_id` varchar(64) DEFAULT NULL COMMENT 'cookie验证id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

