/*Table structure for table `visit_log_db` */

DROP TABLE IF EXISTS `visit_log_db`;

CREATE TABLE `visit_log_db` (
  `visit_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '日志id',
  `user_authentication_id` varchar(128) DEFAULT NULL COMMENT '访问人身份id，如果为游客则为null',
  `visit_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '访问时间',
  `visit_page` varchar(64) NOT NULL COMMENT '访问页面',
  `visit_ip` varchar(32) NOT NULL COMMENT '访问ip地址',
  `visit_address` varchar(64) DEFAULT NULL COMMENT '访问地址',
  `visit_operator` varchar(16) DEFAULT NULL COMMENT '访问运营商',
  `visit_pro` varchar(16) DEFAULT NULL COMMENT '访问省份',
  `visit_city` varchar(16) DEFAULT NULL COMMENT '访问城市',
  `visit_pcode` int(16) DEFAULT NULL COMMENT '省份id',
  PRIMARY KEY (`visit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=976 DEFAULT CHARSET=utf8;

