/*Table structure for table `vrphoto_db` */

DROP TABLE IF EXISTS `vrphoto_db`;

CREATE TABLE `vrphoto_db` (
  `vrphoto_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_authentication_id` varchar(128) NOT NULL COMMENT '用户id，外键',
  `vrphoto_key` varchar(128) NOT NULL COMMENT '图片唯一识别约束',
  `vrphoto_type` varchar(16) NOT NULL COMMENT '图片类型',
  PRIMARY KEY (`vrphoto_id`),
  KEY `user_authentication_id` (`user_authentication_id`),
  KEY `vrphoto_type` (`vrphoto_type`),
  CONSTRAINT `vrphoto_db_ibfk_1` FOREIGN KEY (`user_authentication_id`) REFERENCES `user_db` (`user_authentication_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_db_ibfk_2` FOREIGN KEY (`vrphoto_type`) REFERENCES `photo_type_db` (`photo_type_name`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8;

