/*Table structure for table `vrphoto_info_db` */

DROP TABLE IF EXISTS `vrphoto_info_db`;

CREATE TABLE `vrphoto_info_db` (
  `vrphoto_info_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `vrphoto_info_type` varchar(16) NOT NULL COMMENT '图片类型,sola、combination等',
  `vrphoto_info_content` longtext NOT NULL COMMENT '图片参数设置',
  `vrphoto_id_one` int(11) NOT NULL COMMENT 'vr图片id，该字段不能为空,单张图可存入次字段',
  `vrphoto_id_two` int(11) DEFAULT NULL COMMENT 'vr图片id，该字段可为空',
  `vrphoto_id_three` int(11) DEFAULT NULL COMMENT 'vr图片id，该字段可为空',
  `vrphoto_id_four` int(11) DEFAULT NULL COMMENT 'vr图片id，该字段可为空',
  `vrphoto_id_five` int(11) DEFAULT NULL COMMENT 'vr图片id，该字段可为空',
  `vrphoto_id_six` int(11) DEFAULT NULL COMMENT 'vr图片id，该字段可为空',
  `vrphoto_info_stats` int(5) DEFAULT '1' COMMENT 'vr图片状态',
  `user_authentication_id` varchar(128) NOT NULL COMMENT '用户认证id',
  `vrphoto_info_des` varchar(128) DEFAULT NULL COMMENT '照片介绍',
  `vrphoto_info_time` int(11) NOT NULL DEFAULT '1527252549' COMMENT '上传时间',
  `vrphoto_info_heartnum` int(11) DEFAULT '0' COMMENT '点赞数',
  `vrphoto_info_viewnum` int(11) DEFAULT '0' COMMENT '查看数',
  `vrphoto_info_recommend` int(2) DEFAULT '0' COMMENT '是否上推荐，0不推荐，1推荐',
  PRIMARY KEY (`vrphoto_info_id`),
  KEY `vrphoto_id_one` (`vrphoto_id_one`),
  KEY `vrphoto_id_two` (`vrphoto_id_two`),
  KEY `vrphoto_id_three` (`vrphoto_id_three`),
  KEY `vrphoto_id_four` (`vrphoto_id_four`),
  KEY `vrphoto_id_five` (`vrphoto_id_five`),
  KEY `vrphoto_id_six` (`vrphoto_id_six`),
  KEY `FK_vrphoto_info_db` (`vrphoto_info_stats`),
  KEY `user_authen_id` (`user_authentication_id`),
  CONSTRAINT `FK_vrphoto_info_db` FOREIGN KEY (`vrphoto_info_stats`) REFERENCES `vrphoto_stats` (`vrphoto_stats_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_authen_id` FOREIGN KEY (`user_authentication_id`) REFERENCES `user_db` (`user_authentication_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_1` FOREIGN KEY (`vrphoto_id_one`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_2` FOREIGN KEY (`vrphoto_id_two`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_3` FOREIGN KEY (`vrphoto_id_three`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_4` FOREIGN KEY (`vrphoto_id_four`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_5` FOREIGN KEY (`vrphoto_id_five`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `vrphoto_info_db_ibfk_6` FOREIGN KEY (`vrphoto_id_six`) REFERENCES `vrphoto_db` (`vrphoto_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=utf8;

